views.javaScript:
function order() {
    var oid = $(":hidden[name='oid']").val();
    var action = "/samples/ec01/backoffice/report/order";
    var $form = $("<form method='POST' />").attr({action:contextPath + action}).appendTo("body");
    $("<input />").attr({type:"hidden", name:"oid", value:oid}).appendTo($form);
	$form.submit();
	$form.remove();
}

function settleDownload() {
var oid = $(":hidden[name='oid']").val();
    var action = "/samples/ec01/backoffice/report/settlement";
    var $form = $("<form method='POST' target='_blank' />").attr({action:contextPath + action}).appendTo("body");
    $("<input />").attr({type:"hidden", name:"oid", value:oid}).appendTo($form);
    $form.submit();
	$form.remove();
}
